import React from 'react';
import { w3cwebsocket as W3CWebSocket } from 'websocket';
const client = new W3CWebSocket('ws://192.168.1.11:8000');

class AddOrder extends React.Component {
  state = {
    orders: []
  };

  render() {
    return (
      <div>
        <div className="row">
          <form className="col s12" onChange={e => console.log(e.target.value)}>
            <div className="row">
              <div className="input-field col s12">
                <input id="order_title" type="text" className="validate" />
                <label htmlFor="order_title">Order Title</label>
              </div>
            </div>
          </form>
        </div>
      </div>
    );
  }
}

export default AddOrder;
